import React from 'react';
import Row from './Row';

const RowList = ({ transactions }) => {
    const transactionRows = transactions.map( (i) => {
	  return <Row 
	    key={'transaction-' + i}
	    id={transactions[i].id}
	    date={transactions[i].date}
	    desc={transactions[i].desc}
   	    outflow={transactions[i].outflow}
            inflow={transactions[i].inflow}
	  />
	})
  return (
    <div>
      {transactionRows}
    </div> 
  );
}

export default RowList;
